import ImageSubject from '../favicon.ico';
import Mobile  from './CenterMobile';

export default function TopSubject() {
const Mob = useContext(Mobile);
const [set]=Mob
  return (
    <div className="py-1 text-center">

        <img
          className="d-flex justify-content-center align-items-center mt-2"
          src={ImageSubject}
          alt="ddd"

        type="button"
        onClick={()=>set}
        />

    </div>
  );
}
